/**
 * The different arrow types supported by the
 * {@link arrow PatternFactory.arrow()} pattern.
 *
 * <p>The following image shows the supported arrows.</p>
 *
 * <img src="media://complexstroke/complexStroke_allArrows.png" alt="Illustration of the different arrow types"/>
 *
 * @see {@link arrow PatternFactory.arrow}
 * @since 2018.1
 */
export declare enum ArrowType {
  /**
   * Regular filled arrow, see the {@link ArrowType class doc} for an illustration.
   */
  REGULAR_FILLED = "regular_filled",
  /**
   * Regular outlined arrow, see the {@link ArrowType class doc} for an illustration.
   */
  REGULAR_OUTLINED = "regular_outlined",
  /**
   * Plain arrow, see the {@link ArrowType class doc} for an illustration.
   */
  PLAIN = "plain",
  /**
   * Plain outlined arrow, see the {@link ArrowType class doc} for an illustration.
   */
  PLAIN_OUTLINED = "plain_outlined",
  /**
   * Plain filled arrow, see the {@link ArrowType class doc} for an illustration.
   */
  PLAIN_FILLED = "plain_filled",
  /**
   * Blunt arrow, see the {@link ArrowType class doc} for an illustration.
   */
  BLUNT = "blunt",
  /**
   * Left half arrow, see the {@link ArrowType class doc} for an illustration.
   */
  LEFT_HALF = "left_half",
  /**
   * Right half arrow, see the {@link ArrowType class doc} for an illustration.
   */
  RIGHT_HALF = "right_half",
  /**
   * Double left half arrow, see the {@link ArrowType class doc} for an illustration.
   */
  DOUBLE_LEFT_HALF = "double_left_half",
  /**
   * Double right half arrow, see the {@link ArrowType class doc} for an illustration.
   */
  DOUBLE_RIGHT_HALF = "double_right_half",
}